import React from "react";

function Footer() {
  return (
    <footer className="bg-gray-900 text-gray-300 p-4 mt-10 text-center">
      <p>&copy; {new Date().getFullYear()} Image Forensics. All rights reserved.</p>
      <p className="text-sm">Built with React, Flask, and TailwindCSS</p>
    </footer>
  );
}

export default Footer;
